import React from 'react'

export default function Gallary() {
  const img="https://picsum.photos/id/1060/536/354?blur=2"
  const img1="https://picsum.photos/seed/picsum/536/354"
  const img2="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQPXTVKst79t79RIIff6Lk6ASTIxLtBqu7iSA&usqp=CAU"
  const img3="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSE5QXi5VUZThHH9GhQTrmHB92i0zi_y37B9A&usqp=CAU"
  const img4="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ1XiD94ri1rJJcFxoe0_IKQlj_mD7beq9N2Q&usqp=CAU"
  const img5="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQH0F-tazsp-KU0qkX483NJHYuAva0XvQne9A&usqp=CAU"
  const img6="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQrcv6vZFaWB6jOX4s8tQhLWkjeINgLELiltQ&usqp=CAU"
  const img7="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR-SXBmOBGYaZOO-OeNVR7wWCHCqKru832NDA&usqp=CAU"
  return (
    <div>
      <h1>Gallary</h1>
      <div className='img_div'>
      <img src={img} alt=''/>
      &nbsp;&nbsp;&nbsp;&nbsp;
      <img src={img1}/>
      &nbsp;&nbsp;&nbsp;&nbsp;
      <img src={img2}/>
      &nbsp;&nbsp;&nbsp;&nbsp;
      <img src={img3}/>
      &nbsp;&nbsp;&nbsp;&nbsp;
      <img src={img4}/>
      &nbsp;&nbsp;&nbsp;&nbsp;
      <img src={img5}/>
      &nbsp;&nbsp;&nbsp;&nbsp;
      <img/>
      &nbsp;&nbsp;&nbsp;&nbsp;
      </div>
    </div>
  )
}
